import React, { useState, useEffect } from "react";
import Slider from "react-slick";
import Confetti from "react-confetti";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./App.css";

// Replace these with your actual image imports
import img1 from "crystbirthday/public/img/photo 1.jpg";
import img2 from "crystbirthday/public/img/photo 2 .jpg";
import img3 from "./assets/photo3.jpg";
import img4 from "./assets/photo4.jpg";

const photos = [img1, img2, img3, img4];
const birthdayDate = new Date("2025-05-19T00:00:00"); // Updated to May 19th

function App() {
  const [timeLeft, setTimeLeft] = useState(calculateTimeLeft());
  const [isBirthday, setIsBirthday] = useState(false);
  const [windowSize, setWindowSize] = useState({ 
    width: window.innerWidth, 
    height: window.innerHeight 
  });

  function calculateTimeLeft() {
    const now = new Date();
    const difference = birthdayDate - now;

    if (difference <= 0) return null;

    return {
      days: Math.floor(difference / (1000 * 60 * 60 * 24)),
      hours: Math.floor((difference / (1000 * 60 * 60)) % 24),
      minutes: Math.floor((difference / 1000 / 60) % 60),
      seconds: Math.floor((difference / 1000) % 60)
    };
  }

  useEffect(() => {
    const timer = setInterval(() => {
      const newTimeLeft = calculateTimeLeft();
      setTimeLeft(newTimeLeft);
      setIsBirthday(!newTimeLeft);
    }, 1000);

    const handleResize = () => setWindowSize({
      width: window.innerWidth,
      height: window.innerHeight
    });

    window.addEventListener("resize", handleResize);
    return () => {
      clearInterval(timer);
      window.removeEventListener("resize", handleResize);
    };
  }, []);

  const sliderSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
    arrows: true,
    adaptiveHeight: true
  };

  return (
    <div className="App">
      {isBirthday && <Confetti {...windowSize} recycle={false} />}

      <header className="header">
        <h1>Happy Birthday, Angel! 🎂</h1>

        {!isBirthday ? (
          <div className="countdown">
            <p>Countdown to Your Special Day:</p>
            <div className="timer">
              <div><span>{timeLeft?.days ?? 0}</span>Days</div>
              <div><span>{timeLeft?.hours ?? 0}</span>Hours</div>
              <div><span>{timeLeft?.minutes ?? 0}</span>Minutes</div>
              <div><span>{timeLeft?.seconds ?? 0}</span>Seconds</div>
            </div>
          </div>
        ) : (
          <div className="celebration">
            <h2>🎉 Today's the Day! 🎉</h2>
            <p>Wishing you an amazing birthday filled with love and joy!</p>
          </div>
        )}
      </header>

      <section className="gallery">
        <Slider {...sliderSettings}>
          {photos.map((photo, index) => (
            <div key={index} className="slide">
              <img 
                src={photo} 
                alt={`Beautiful memory ${index + 1}`} 
                className="slide-image"
              />
            </div>
          ))}
        </Slider>
      </section>

      <footer>
        <p>Created with ❤️ for the most wonderful person!</p>
      </footer>
    </div>
  );
}

export default App;
